import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  Menu,
  MenuItem,
  IconButton,
} from '@mui/material';
import {
  AccountCircle,
  ExpandMore,
  Dashboard,
  EventNote,
  MedicalServices,
  Assignment,
  Info,
  ContactSupport,
} from '@mui/icons-material';

const Navbar = () => {
  const navigate = useNavigate();
  const [anchorEl, setAnchorEl] = useState(null);

  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Add logout logic here
    navigate('/login');
  };

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          Spital Management
        </Typography>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <Button
            color="inherit"
            component={Link}
            to="/dashboard"
            startIcon={<Dashboard />}
          >
            Dashboard
          </Button>
          
          <Button
            color="inherit"
            component={Link}
            to="/appointment"
            startIcon={<EventNote />}
          >
            Appointments
          </Button>

          <Button
            color="inherit"
            component={Link}
            to="/medical-records"
            startIcon={<MedicalServices />}
          >
            Medical Records
          </Button>

          <Button
            color="inherit"
            component={Link}
            to="/prescriptions"
            startIcon={<Assignment />}
          >
            Prescriptions
          </Button>

          <Button
            color="inherit"
            component={Link}
            to="/about"
            startIcon={<Info />}
          >
            About
          </Button>

          <Button
            color="inherit"
            component={Link}
            to="/contact"
            startIcon={<ContactSupport />}
          >
            Contact
          </Button>

          <IconButton
            color="inherit"
            onClick={handleMenu}
            sx={{ ml: 1 }}
          >
            <AccountCircle />
            <ExpandMore />
          </IconButton>
          
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleClose}
          >
            <MenuItem component={Link} to="/profile" onClick={handleClose}>
              My Profile
            </MenuItem>
            <MenuItem component={Link} to="/settings" onClick={handleClose}>
              Settings
            </MenuItem>
            <MenuItem onClick={() => { handleClose(); handleLogout(); }}>
              Logout
            </MenuItem>
          </Menu>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
